import React from "react";
import { Link } from "react-router-dom";

const Navbar = () => {
  return (
    <div className="container-fluid">
      <div className="row">
        <div className="col-sm-4">
          <Link to="/reg">Reg</Link>
          <Link to="/home">Reg</Link>
        </div>
      </div>
    </div>
  );
};
